CREATE DATABASE IF NOT EXISTS master_inventory; 
USE master_inventory;

SELECT 'CREATING DATABASE STRUCTURE' AS 'INFO';

/*!50503 set default_storage_engine = InnoDB */;
/*!50503 select CONCAT('storage engine: ', @@default_storage_engine) as INFO */;

DROP TABLE IF EXISTS inv,
					Categories,
                    location,
                    user_name_wizard;
                    
CREATE TABLE categories (
    ctgy_id INT NOT NULL,
    ctgy_name VARCHAR(255) NOT NULL,
    PRIMARY KEY (ctgy_id)
);

CREATE TABLE types (
    type_id VARCHAR(255) NOT NULL,
    type_name VARCHAR(255) NOT NULL,
    PRIMARY KEY (type_id)
);

CREATE TABLE employee_info (
    emp_id INT NOT NULL,
    emp_name VARCHAR(255) NOT NULL,
    email_id VARCHAR(1000) NULL,
    user_name VARCHAR(1000) NOT NULL,
    user_type VARCHAR(255) NOT NULL,
    password VARCHAR(255) NOT NULL,
    PRIMARY KEY (emp_id)
);

CREATE TABLE owner (
    owner_id INT NOT NULL,
    owner_name VARCHAR(255) NOT NULL,
    emp_id INT NOT NULL,
    PRIMARY KEY (owner_id),
    FOREIGN KEY (emp_id)
        REFERENCES employee_info (emp_id)
        ON DELETE CASCADE
);

CREATE TABLE location (
    lc_id VARCHAR(255) NOT NULL,
    lc_name VARCHAR(255) NOT NULL,
    PRIMARY KEY (lc_id)
);

                    
CREATE TABLE inventory (
    item_no INT NOT NULL AUTO_INCREMENT,
    product_name VARCHAR(1000) NOT NULL,
    description VARCHAR(500) NOT NULL,
    ctgy_id INT NOT NULL,
    type_id VARCHAR(255) NOT NULL,
    inv_qty INT NOT NULL,
    min_stock INT NULL,
    unit_price INT NULL,
    owner_id INT NULL,
    lc_id VARCHAR(255) NOT NULL,
    zone VARCHAR(255) NOT NULL,
    cabinet INT NOT NULL,
    bin_no INT NULL,
    total_price INT NULL,
    PRIMARY KEY (item_no),
    FOREIGN KEY (ctgy_id)
        REFERENCES categories (ctgy_id),
    FOREIGN KEY (type_id)
        REFERENCES types (type_id),
    FOREIGN KEY (lc_id)
        REFERENCES location (lc_id),
    FOREIGN KEY (owner_id)
        REFERENCES owner (owner_id)
);

CREATE TABLE user_history (
    emp_id INT NOT NULL,
    item_no INT NOT NULL,
    product_name VARCHAR(1000) NOT NULL,
    borrowed_or_consumed_qty INT NOT NULL,
    FOREIGN KEY (item_no)
        REFERENCES inventory (item_no),
	FOREIGN KEY (emp_id)
        REFERENCES employee_info (emp_id)
        ON DELETE CASCADE
);


flush /*!50503 binary */ logs;

                         







